import React from "react";
import "./styles.scss";

export function SearchBar() {
  return (
    <div className="container">
      <div className="search">
        <input className="search__input" placeholder="shorten a link here" />
        <button className="search__button">Shorten it!</button>
      </div>
      <div>
        <div className="list">
          <p className="list__item__url">name</p>
          <p className="list__item__link">link</p>
          <button className="list__item__copy">Copy</button>
        </div>
      </div>
    </div>
  );
}
